currDate =currDate .toLocaleTimeString();
const greeting ='Good Morning';

ReactDOM.render(
 <React.Fragment>
   <div>
   <h1>Hello Sir,<span>{greeting}</span></h1>
   </div>


 </React.Fragment>
 ,document.getElementById('root'));
